import{_ as t,o as i,c as o,O as e}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 32.1-134.4 Right of podiatrists or nurse practitioners to injunction.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/32.1-134.4.md","filePath":"vacode/32.1-134.4.md"}'),r={name:"vacode/32.1-134.4.md"},a=e('<h1 id="§-32-1-134-4-right-of-podiatrists-or-nurse-practitioners-to-injunction" tabindex="-1">§ 32.1-134.4 Right of podiatrists or nurse practitioners to injunction. <a class="header-anchor" href="#§-32-1-134-4-right-of-podiatrists-or-nurse-practitioners-to-injunction" aria-label="Permalink to &quot;§ 32.1-134.4 Right of podiatrists or nurse practitioners to injunction.&quot;">​</a></h1><p>Any licensed podiatrist or certified nurse midwife licensed as a nurse practitioner in Virginia who is aggrieved by any violation of § <a href="http://law.lis.virginia.gov/vacode/32.1-134.2/" target="_blank" rel="noreferrer">32.1-134.2</a> or § <a href="http://law.lis.virginia.gov/vacode/32.1-134.3/" target="_blank" rel="noreferrer">32.1-134.3</a> shall have the right to seek an injunction from the circuit court of the city or county in which the hospital alleged to have committed the violation is located, prohibiting any further such violation. The provisions of this section shall not be deemed to impair or affect any other right or remedy. A violation of this section, however, shall not constitute a violation of the provisions of this article for the purposes of § <a href="http://law.lis.virginia.gov/vacode/32.1-135/" target="_blank" rel="noreferrer">32.1-135</a>.</p><p>1983, c. 259; 1992, c. 452.</p>',3),n=[a];function s(c,h,l,d,p,f){return i(),o("div",null,n)}const v=t(r,[["render",s]]);export{u as __pageData,v as default};
